import { useEffect } from "react";
import { Block } from "@material-ui/icons";
import "./Card.css";
import imgs from "./data";
import "./Offer.css";
import Left from "@material-ui/icons/ArrowBackIosRounded";
import Right from "@material-ui/icons/ArrowForwardIosRounded";

const Card = (property) => {
  const index = property.property;
  const len = imgs.properties.length;
  const p = imgs.properties[index % len];
  const picture = p.picture;
  const f = p.index;

  return (
    <div
      id={"card-${index}"}
      className="card"
      onAnimationIteration={property.animat}
    >
      <div className="offer">
        <button
          className="btn"
          onClick={() => property.fun1}
          disabled={property.indexNext === 0}
        >
          <Left id="si2" />
        </button>
      </div>
      <img src={picture} className="image"></img>
      <div className="offer">
        <button
          className="btn"
          onClick={() => property.animat}
          disabled={property.indexNext === imgs.properties.length - 1}
        >
          <Right id="si3" />
        </button>
      </div>
    </div>
  );
};
export default Card;
